  return(
    <div style={{backgroundColor: 'black'}} onClick={() => {
      alert('You Clicked div');
    }}>
      <Button lalala={() => {alert('Play Movie')}}>
        Play Movie  
      </Button>
      <Button lalala={() => {alert('Play Song')}}>
        Play Song
      </Button>
    </div>
  )
}
function Button({children, lalala}){
  return(
    <button onClick={(e) => {
      e.stopPropagation();
      lalala();
    }}>
      {children}
    </button>
  )
}
